import React from 'react';
import Staffnavbar from './Staffnavbar';
import { useDispatch, useSelector} from 'react-redux';
import { useEffect } from 'react';
import axios from 'axios';
import { listError, listLoading, listSuccess } from '../../redux/staff/Actions';
import '../styles/Forms.css';

const StaffStudent = () => {
const dispatch=useDispatch();
const {data}= useSelector(state=>state.staff.list);
let handlefetch=()=>{
dispatch(listLoading())
  axios({
    method: "get",
    url: 'http://localhost:8000/managerapi/student/',
}).then((response)=>{
  dispatch(listSuccess(response.data));
}).catch((error)=>{
  dispatch(listError());
  let errmessage=error.response.data.Email;
  alert("Error :"+errmessage);
})
}
useEffect(()=>{
  handlefetch();
},[])
  return (
    <>
    <Staffnavbar/>
    <div style={{marginTop:"3vw"}}>
        {data.filter(ele=>ele.isActive).map((ele) => (
        <div style={{width:"30%", padding:"1.vw", border:"1px solid #28a745", marginLeft:"auto", marginRight:"auto",marginBottom:"2vw"}}>
        <p>Name : {ele.Name}</p>
        <p>Email : {ele.Email}</p>
        <p>Field_of_study : {ele.Field_of_study}</p>
        <input type="button" value="Disable"/>
        </div>))}
    </div>
    </>
  )
}

export default StaffStudent
